import * as types from './../constants/ActionTypes';

axios({
    url: `${config.baseUrl}/api/get-all`,
    method: 'get'
    })
    .then((response) => {
        initialState = response.data;
    })
    .catch((error) => {
        console.log(error)
    });

export const status = () => {
    return{
        type : types.TOGGLE_STATUS,
    }
}

export const showAll = () => {
    return {
        type : types.SHOW_ALL,

    }
}

export const showModel = () => {
    return {
        type : types.SHOW_MODEL,

    }
}

export const showGood = () => {
    return {
        type : types.SHOW_GOOD,

    }
}
